class Solution {
    public int minSizeSubarray(int[] nums, int target) {
        int n = nums.length;
        int minLen = Integer.MAX_VALUE;
        int[] prefixSum = new int[2 * n + 1];
        for (int i = 0; i < 2 * n; i++) {
            prefixSum[i + 1] = prefixSum[i] + nums[i % n];
        }

        for (int i = 0; i < n; i++) {
            int need = target + prefixSum[i];
            int low = i + 1, high = 2 * n;
            while (low <= high) {
                int mid = low + (high - low) / 2;
                if (prefixSum[mid] < need) {
                    low = mid + 1;
                } else {
                    high = mid - 1;
                }
            }
            if (low <= 2 * n) {
                minLen = Math.min(minLen, low - i);
            }
        }

        return minLen == Integer.MAX_VALUE ? -1 : minLen;
    }
}
